import { Box } from '@material-ui/core';
import React from 'react';
import { WorkTaskBubble } from '../Bubble/WorkTaskBubble';
import { PickWorkTask } from '../RenderTaskList';

interface InputProps {
  date: number;
  workData: PickWorkTask[];
}

export function WorkTaskList({ date, workData }: InputProps) {
  return (
    <Box
      padding={'0px 50px'}
      width={'30%'}
      style={{ border: '3px solid #ebebeb', borderTop: 0, borderBottom: 0 }}
    >
      {WorkTaskBubble({
        date,
        workData
      })}
    </Box>
  );
}
